import React, { useState } from 'react';
import './App.test';
import Header from './Component/Header/Header';
import Home from './Component/Main/Home/Home';
import Schedule from './Component/Main/Schedule/Schedule';
import Program from './Component/Main/Program/Program';
import Events from './Component/Main/UpcomingEvents/upcomingEvents';
import ContactUs from './Component/Main/ContactUs/ContactUs';
import Merchandise from './Component/Main/Merchandise/Merchandise'; 
import News from './Component/Main/News/News';
import Footer from './Component/Footer/Footer';
import ScrollToTopButton from './Component/Main/ScrollToTop/ScrollToTop';
import errorBoundary from './Component/errorBoundary';
import Weather from './Component/Main/Weather/Weather';
import SearchLogic from './Component/Main/searchBar/searchBar';
import SearchBar from './Component/Main/searchBar/searchLogic';

function App() {
  const [searchText, setSearchText] = useState('');
  const [searchResults, setSearchResults] = useState([]);

  const handleSearch = (query) => {
    setSearchText(query);
    // Perform search logic and update search results
    // For simplicity, I'm just updating the state directly here
    setSearchResults([
      { title: 'Search Result 1', url: '/search-result-1' },
      { title: 'Search Result 2', url: '/search-result-2' },
    ]);
  };

  const handleClose = () => {
    setSearchText('');
    setSearchResults([]);
  };

  return (
    <div className="App">
      <Header searchResults={searchResults} /> {/* Pass searchResults prop */}
      <Home />
      <Schedule />
      <Program />
      <Events />
      <News />
      <Weather />
      <Merchandise />
      <ContactUs />
      <Footer />
      <ScrollToTopButton />
      <SearchBar onSearch={handleSearch} onClose={handleClose} />
      <SearchLogic searchText={searchText} />
    </div>
  );
}

export default App;
